import React, { useState } from "react";
import axios from "axios";
import TextField from "@mui/material/TextField";
import Button from "@mui/material/Button";
import Paper from "@mui/material/Paper";
import Typography from "@mui/material/Typography";
import styled from "@mui/material/styles/styled";
import GoogleLogin from "react-google-login";
import { gapi } from "gapi-script";
//import { chatui } from "../chatui/index"
import { useNavigate } from "react-router-dom";

const Container = styled("div")({
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
    justifyContent: "center",
    height: "100vh",
});

const PaperWrapper = styled(Paper)(({ theme }) => ({
    padding: theme.spacing(4),
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
    width: 300,
    height: 510,
}));

const Form = styled("form")(({ theme }) => ({
    width: "100%",
    marginTop: theme.spacing(1),
}));

const SubmitButton = styled(Button)(({ theme }) => ({
    margin: theme.spacing(3, 0, 2),
}));

function Login() {
    const [email, setEmail] = useState("");
    const [password, setPassword] = useState("");
    const [googleResponse, setGoogleResponse] = useState(null); // Estado para armazenar a resposta do Google
    const navigate = useNavigate();

    const handleLogin = () => {
        // Faça a chamada para autenticação no backend usando Axios.
        // Certifique-se de implementar essa função no seu backend.
        axios
            .post("/api/login", { email, password })
            .then((response) => {
                // Lida com a resposta do servidor e redireciona o usuário, se necessário.
                navigate("/chatui", { state: { googleResponse } });
            })
            .catch((error) => {
                // Lida com erros de autenticação, como credenciais inválidas.
                navigate("/chatui");
            });
    }

    const responseGoogle = (response) => {
        function start() {
            gapi.client.init({
                clientId: process.env.REACT_PUBLIC_GOOGLE_CLIENT_ID,
                scope: 'email',
            });
        }
        gapi.load('client:auth2', start);

        setGoogleResponse(response);

        // Redirecione para a página de chatui e passe a resposta do Google como uma propriedade
        navigate("/chatui", { state: { googleResponse: response } });
    }

    return (
        <Container>
            <PaperWrapper>
                <img
                    src="/logo.png"
                    alt="Seu Logo"
                    width="85"
                    height="80"
                />
                <Typography component="h1"
                    variant="h5"
                    marginTop="15px"
                    color="gray">
                    Login
                </Typography>
                <Form>
                    <TextField
                        variant="outlined"
                        margin="normal"
                        required
                        fullWidth
                        id="email"
                        label="Email Address"
                        name="email"
                        autoComplete="email"
                        value={email}
                        onChange={(e) => setEmail(e.target.value)}
                        InputProps={{
                            style: { color: "gray" },
                        }}
                        InputLabelProps={{
                            style: { color: "gray" },
                        }}
                    />
                    <div style={{ marginBottom: '20px' }}>
                        <TextField
                            variant="outlined"
                            margin="normal"
                            required
                            fullWidth
                            name="password"
                            label="Password"
                            type="password"
                            id="password"
                            autoComplete="current-password"
                            value={password}
                            onChange={(e) => setPassword(e.target.value)}
                            InputProps={{
                                style: { color: "gray" },
                            }}
                            InputLabelProps={{
                                style: { color: "gray" },
                            }}
                        />
                    </div>
                    <div>
                        <GoogleLogin
                            clientId="136886314057-fl3qia40o1o4h85bi4iqbr61qrfcaaau.apps.googleusercontent.com"
                            buttonText="Continue login with Google"
                            onSuccess={responseGoogle}
                            onFailure={responseGoogle}
                        />
                    </div>
                    <div>
                        <SubmitButton
                            type="button"
                            fullWidth
                            variant="contained"
                            style={{ color: "white", backgroundColor: "primary" }}
                            onClick={handleLogin}
                        >
                            Login
                        </SubmitButton>
                    </div>
                    <div style={{ marginTop: '-20px' }}>
                        <SubmitButton
                            type="button"
                            fullWidth
                            variant="contained"
                            style={{ color: "white", backgroundColor: "primary" }}
                            onClick={() => navigate("/signup")}
                        >
                            Sign Up
                        </SubmitButton>
                    </div>


                </Form>
            </PaperWrapper>
        </Container>
    );
}

export default Login;
